import React from "react";
import "../Styles/Payment.css"
import "../Styles/Main.css"
import { PaymentHeader, PayAccountUser, PayOrderProcess, PayyMenthod, PayNote } from "../Components/Payment"; 


export default function Payments(){
    return(
        <div>
        <PaymentHeader />
        <PayAccountUser />
        <PayOrderProcess />
        <PayyMenthod />
        <PayNote />
        </div>
  
    );
}
